export const TopBar: React.FC = () => {

  return (
    <TopBarCollections>
      <MenuItem active>
     <img src={home} alt="" />
        <span>Home</span>
      </MenuItem>


      <MenuItem >
      <img src={browse} alt="" />
        <span>Browser</span>
      </MenuItem>

      <MenuItem>
      <img src={radio} alt="" />
        <span>Radio</span>
      </MenuItem>

    </TopBarCollections>
  );
};
